import styled from 'styled-components';

export const HomeWidget=styled.div`
    margin:20px 20%;
    overflow:hidden;
`
export const HomeLeftWidget=styled.div`
    width:66%;
    margin:0 2%;
    float:left;
    .HomeImg{
        display:block;
        width:100%;
        height:280px;
        margin:0;
        box-shadow:2px 2px 8px #333333;
        border-radius:4px;
    }
`
export const HomeRightWidget=styled.div`
    width:30%;
    float:right;

`

// Topic
export const TopicWidget=styled.div`
    padding:20px 10px 0 0;
    overflow:hidden;
`
export const TopicItem=styled.div`
    cursor:pointer;
    text-align:center;
    float:left;
    margin:0 18px 18px 0;
    height:32px;
    line-height:32px;
    border-radius:4px;
    color:#000;
    font-size:13px;
    background:#F7F7F7;
    border:1px solid #dcdcdc;
    padding-right:10px;
    border-bottom:1px solid #f0f0f0;
    .TopicItemImg{
        display:block;
        width:40px;
        height:32px;
        float:left;
        border-radius:4px 0 0 4px;
        margin-right:10px;
    }
`
export const MoreItem= styled.div`
    float:left;
    line-height:32px;
    font-size:13px;
    font-weight:500;
    .more{
        float:right;
        margin:13px px 0 5px;
    }

`
//list
export const ListWidget =styled.div`

`
export const ListItem=styled.div`
    overflow:hidden;
    padding:10px 15px;
    border-bottom:1px solid #f0f0f0;
    .ListImg{
        float:right;
        width:21%;
        margin: 0 2%;
    }
`
export const ListItemText=styled.div`
    width:75%;
    float:left;
`
